description:
from the collection of "outside: people we do not see":
He never wanted to leave. But when he left, someone aimed his gun at him. A stranger who was very much like himself, as if standing in front of a mirror. He was wearing a hat, his clothes were all dusty, he was panting and his eyes were twinkling in the bowl. Someone who had a woman like him sitting somewhere behind a window. Like him, he never wanted to leave, His hand was shaking on the trigger and his legs were not alive ... Like him, he never returned home, although he never wanted to leave...
What if the guns fired flowers instead of bullets?
